import React from "react";
import { Counter } from "./Counter";
import { Welcome } from "./Welcome";

export class App extends React.Component {
  render() {
    return (
      <div>
        <Welcome name="John" />
        <Counter
          initialValue={0}
          incrementInterval={1000}
          incrementAmount={1}
        />
      </div>
    );
  }
}

export function Hi(name) {
  return <h1>Hello, {name}</h1>;
}
